‚ÄúTahoe OG by Northwest Grown;
Heavy and relaxing. Listening to some Bob Marley while planning my day tomorrow. This strain is great after a day of jetskiing, lazing about in the sun by the lake. Feeling surprisingly focused, but also like i could go to sleep if i wanted to. Second or third time i've smoked this by itself. Mixed it with some Sour OG yesterday, that was pretty good. Very chill.
5/5 Jetskis.‚Äù

